, 
[75433007] = {id = 75433007, remark = "リーダー様は近頃、わたくしの教えをしっかり守り、\nどこもかしこも清潔しておられます。", type = 1, option_ids = "0", next = 75433008, role_ids = "75200331", expression = "0", action = "0", action_type = "0", role_type = 75200331, position = "418:606:10050", scene_effect_position = "1:2", expression_position = "1:2", carmera = 51100001, carmera_time = 1, role_shake = "0", bgm = 1020009}
