[75433008] = {id = 75433008, remark = "非常に喜ばしいことなのですが…\nだからこそ、思うことがあります。", type = 1, option_ids = "0", next = 75433009, role_ids = "75200331", expression = "0", action = "0", action_type = "0", role_type = 75200331, position = "418:606:10050", scene_effect_position = "1:2", expression_position = "1:2", carmera = 51100001, carmera_time = 1, role_shake = "0", bgm = 1020009}
, 
[75433009] = {id = 75433009, remark = "以前も申し上げました通り、清潔な環境に\n掃除人であるわたくしは不要…", type = 1, option_ids = "0", next = 75433010, role_ids = "75200331", expression = "0", action = "0", action_type = "0", role_type = 75200331, position = "418:606:10050", scene_effect_position = "1:2", expression_position = "1:2", carmera = 51100001, carmera_time = 1, role_shake = "0", bgm = 1020009}
, 
[75433010] = {id = 75433010, remark = "もう、潮時なのかもしれません。", type = 1, option_ids = "75503301:75503302", next = 0, role_ids = "75200331", expression = "0", action = "0", action_type = "0", role_type = 75200331, position = "418:606:10050", scene_effect_position = "1:2", expression_position = "1:2", carmera = 51100001, carmera_time = 1, role_shake = "0", bgm = 1020009}
, 
[75433011] = {id = 75433011, remark = "そんな提案をされては…\nわたくしも、困ってしまいます。", type = 1, option_ids = "0", next = 75433012, role_ids = "75200331", expression = "0", action = "0", action_type = "0", role_type = 75200331, position = "418:606:10050", scene_effect_position = "1:2", expression_position = "1:2", carmera = 51100001, carmera_time = 1, role_shake = "0", bgm = 1020009}
