[75433701] = {id = 75433701, remark = "おはようございます、リーダー様。", type = 1, option_ids = "0", next = 75433702, role_ids = "75200331", expression = "0", action = "0", action_type = "0", role_type = 75200331, position = "418:606:10050", role_admission_type = "75200331:0:0", scene_effect_position = "1:2", expression_position = "1:2", carmera = 51100001, carmera_time = 1, role_shake = "0", bgm = 1020001}
, 
[75433702] = {id = 75433702, remark = "本日はとてもいい天気ですので、\nわたくし洗濯をしておりました。", type = 1, option_ids = "0", next = 75433703, role_ids = "75200331", expression = "0", action = "0", action_type = "0", role_type = 75200331, position = "418:606:10050", scene_effect_position = "1:2", expression_position = "1:2", carmera = 51100001, carmera_time = 1, role_shake = "0", bgm = 1020001}
, 
