, 
[75433704] = {id = 75433704, remark = "…む！　こんなところにモンスターが…！\nリーダー様、お下がりください。", type = 1, option_ids = "0", next = -1, role_ids = "75200331", expression = "0", action = "0", action_type = "0", role_type = 75200331, position = "418:606:10050", scene_effect_position = "1:2", expression_position = "1:2", carmera = 51100001, carmera_time = 1, role_shake = "0", bgm = 1020010}
, 
[75433705] = {id = 75433705, remark = "まさか洗濯物を蹴飛ばされるとは…\n不覚でございます。", type = 1, option_ids = "0", next = 75433706, role_ids = "75200331", expression = "0", action = "0", action_type = "0", role_type = 75200331, position = "418:606:10050", role_admission_type = "75200331:0:0", scene_effect_position = "1:2", expression_position = "1:2", carmera = 51100001, carmera_time = 1, role_shake = "0", bgm = 1020004}
, 
[75433706] = {id = 75433706, remark = "仕方ありません。洗濯のし直しをいたします。", type = 1, option_ids = "75503371:75503372", next = 0, role_ids = "75200331", expression = "0", action = "0", action_type = "0", role_type = 75200331, position = "418:606:10050", scene_effect_position = "1:2", expression_position = "1:2", carmera = 51100001, carmera_time = 1, role_shake = "0", bgm = 1020004}
, 
[75433707] = {id = 75433707, remark = "まぁ…リーダー様の\nやる気が出るだなんて、喜ばしい限りです。", type = 1, option_ids = "0", next = 75433709, role_ids = "75200331", expression = "0", action = "0", action_type = "0", role_type = 75200331, position = "418:606:10050", scene_effect_position = "1:2", expression_position = "1:2", carmera = 51100001, carmera_time = 1, role_shake = "0", bgm = 1020004}
, 
[75433708] = {id = 75433708, remark = "…わかりました、そうおっしゃって\nいただけるのでしたら、ぜひ。", type = 1, option_ids = "0", next = 75433709, role_ids = "75200331", expression = "0", action = "0", action_type = "0", role_type = 75200331, position = "418:606:10050", scene_effect_position = "1:2", expression_position = "1:2", carmera = 51100001, carmera_time = 1, role_shake = "0", bgm = 1020004}
, 
[75433709] = {id = 75433709, remark = "では、わたくしが洗濯の極意をお教えいたしましょう。\nしっかりと習得してくださいまし、リーダー様。", type = 1, option_ids = "0", next = -1, role_ids = "75200331", expression = "0", action = "0", action_type = "0", role_type = 75200331, position = "418:606:10050", scene_effect_position = "1:2", expression_position = "1:2", carmera = 51100001, carmera_time = 1, role_shake = "0", bgm = 1020004}
, 
[75433801] = {id = 75433801, remark = "モンスターに襲われた村というのは\nこちらですね、リーダー様。", type = 1, option_ids = "0", next = 75433802, role_ids = "75200331", expression = "0", action = "0", action_type = "0", role_type = 75200331, position = "418:606:10050", role_admission_type = "75200331:0:0", scene_effect_position = "1:2", expression_position = "1:2", carmera = 51100001, carmera_time = 1, role_shake = "0", bgm = 1020007}
, 
[75433802] = {id = 75433802, remark = "たしかに荒れ果て、村人にも生気が感じられません。\n家にまでモンスターが押し入った形跡もあります。", type = 1, option_ids = "0", next = 75433803, role_ids = "75200331", expression = "0", action = "0", action_type = "0", role_type = 75200331, position = "418:606:10050", scene_effect_position = "1:2", expression_position = "1:2", carmera = 51100001, carmera_time = 1, role_shake = "0", bgm = 1020007}
, 
