, 
[75433804] = {id = 75433804, remark = "リーダー様は、わたくしがすべてを破壊するなどという\n勘違いをなさっているようですね。", type = 1, option_ids = "0", next = 75433805, role_ids = "75200331", expression = "0", action = "0", action_type = "0", role_type = 75200331, position = "418:606:10050", scene_effect_position = "1:2", expression_position = "1:2", carmera = 51100001, carmera_time = 1, role_shake = "0", bgm = 1020007}
, 
[75433805] = {id = 75433805, remark = "わたくしは破壊者ではなく、掃除人でございます。\n破壊のみが掃除にあらず、でございます。", type = 1, option_ids = "0", next = 75433807, role_ids = "75200331", expression = "0", action = "0", action_type = "0", role_type = 75200331, position = "418:606:10050", scene_effect_position = "1:2", expression_position = "1:2", carmera = 51100001, carmera_time = 1, role_shake = "0", bgm = 1020007}
, 
[75433806] = {id = 75433806, remark = "さすがリーダー様。わたくしのことをよくご理解\nなさっていらっしゃいますね。", type = 1, option_ids = "0", next = 75433807, role_ids = "75200331", expression = "0", action = "0", action_type = "0", role_type = 75200331, position = "418:606:10050", scene_effect_position = "1:2", expression_position = "1:2", carmera = 51100001, carmera_time = 1, role_shake = "0", bgm = 1020007}
, 
[75433807] = {id = 75433807, remark = "リーダー様、早速掃除に取り掛かりましょう。\nそちらの村人の方々もお手を貸してくださいませ。", type = 1, option_ids = "0", next = 75433808, role_ids = "75200331", expression = "0", action = "0", action_type = "0", role_type = 75200331, position = "418:606:10050", scene_effect_position = "1:2", expression_position = "1:2", carmera = 51100001, carmera_time = 1, role_shake = "0", bgm = 1020007}
, 
[75433808] = {id = 75433808, remark = "皆さまはまず、モンスターに踏み込まれた室内の泥を\nどかし、割れた窓や花瓶の欠片を拾ってくださいまし。", type = 1, option_ids = "0", next = 75433809, role_ids = "75200331", expression = "0", action = "0", action_type = "0", role_type = 75200331, position = "418:606:10050", scene_effect_position = "1:2", expression_position = "1:2", carmera = 51100001, carmera_time = 1, role_shake = "0", bgm = 1020007}
, 
